[[File:Silver key brown detail.png|140px|left]]
'''Silver key brown''' is a key and reward from the [[Shades of Mort'ton (minigame)|Shades of Mort'ton]] minigame. To obtain it, the player must kill either a [[fiyr shade]] or an [[asyn shade]] and then burn its [[Shade remains|remains]] on a pyre. The key may be used to enter the [[Shade Catacombs]] and then open the correctly coloured chest. It will open a [[Silver Chest (brown)|silver-framed chest with a brown lock]]. This type of key can be used to open any door within the tombs except the gold doors.

